import React, { PureComponent } from 'react';
import  "../../../util";
import ReturnIcon from "./img/returnIcon.png"
import RefreshIcon from "./img/refreshIcon.png"
import WholeIcon from "./img/wholeIcon.png"
import { Select, Icon } from 'antd';
import style from "./TitleDropDown.module.css";
import "./Title.css";
const { Option } = Select;
export default class TitleCompent extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {
			
        };
		this.handleChange = this.handleChange.bind(this);
    }
	handleChange(event) {
        this.setState({value: event.target.value});
    }
    render() {
		const icon = <Icon type="caret-down" style={{ color: "rgb(0, 83, 229)" }} />
        return (
            <div id="title">
				<div className="icon">
					<img src={ReturnIcon}/>
					<img src={RefreshIcon}/>
					<img src={WholeIcon}/>
				</div>
				<div className="menue">
                    <Select value={this.state.value} size="small" suffixIcon={icon} dropdownClassName={style.titleDropdownMenu} onChange={this.handleChange}>
                        <option value="running">running</option>
                        <option value="basketball">basketball</option>
                    </Select>
				</div>	
            </div>
        );
    }
}
